module.exports = async d => {
    const code = d.command.code

    const r = code.split("$isValidObject[").length - 1

    const inside = code.split("$isValidObject[")[r].split("]")[0]

    try {
      var json = JSON.parse(inside)
    } catch(err) {
      
    }

    return {
        code: code.replaceLast(`$isValidObject[${inside}]`, json ? true : false)
    }
}